INSERT INTO `wp_posts` VALUES (1,1,'2017-12-19 09:30:21','2017-12-19 06:30:21','Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!','Привет, мир!','','trash','open','open','','privet-mir__trashed','','','2017-12-26 12:11:29','2017-12-26 09:11:29','',0,'http://diple.dom/?p=1',0,'post','',1),(2,1,'2017-12-19 09:30:21','2017-12-19 06:30:21','Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\n\n<blockquote>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\n\n...или так:\n\n<blockquote>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\n\nПерейдите <a href=\"http://diple.dom/wp-admin/\">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!','Пример страницы','','trash','closed','open','','sample-page__trashed','','','2017-12-19 11:20:00','2017-12-19 08:20:00','',0,'http://diple.dom/?page_id=2',0,'page','',0),(13,1,'2017-12-19 11:20:00','2017-12-19 08:20:00','Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\n\n<blockquote>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\n\n...или так:\n\n<blockquote>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех п